import React from "react";

const Button = ({ icon, name, rounded }) => {
  return (
    <>
      {rounded ? (
        <button class="px-7 py-4 text-[#F86061] border-2 border-[#F86061] rounded-xl text-md hover:bg-[#F86061] hover:text-white transition-all">
          <img src={icon} alt="" /> {name}
        </button>
      ) : (
        <button class="px-7 py-4 bg-[#F86061] text-white rounded-xl text-md hover:opacity-80 transition-all">
          <img src={icon} alt="" /> {name}
        </button>
      )}
    </>
  );
};

export default Button;
